    var ventas=ventasGeneral.filter(ventasGeneral=>parseFloat(ventasGeneral.id)==parseFloat(c))
    var fil=clientesGeneral.filter(clientesGeneral=>parseFloat(clientesGeneral.id)==parseFloat(ventas[0].idCliente))
